package main

import "fmt"

type Pair struct {
    row, col int
}

var directions = [][]int{[]int{0, 1}, []int{1, 0}, []int{0, -1}, []int{-1, 0}}

func bfs(r, c, rows, cols, rmin, cmin, rmax, cmax int, land [][]int, seen map[Pair]bool) ([][]int, int, int, int, int) {
    dq := [][]int{[]int{r, c}}
    for len(dq) > 0 {
        size := len(dq)
        for i := 0; i < size; i++ {
            row, col := dq[0][0], dq[0][1]
            dq = dq[1:]
            for _, arr := range directions {
                dr, dc := arr[0], arr[1]
                rnew, cnew := row+dr, col+dc
                if 0 <= rnew && rnew < rows && 0 <= cnew && cnew < cols {
                    if land[rnew][cnew] == 1 {
                        _, ok := seen[Pair{rnew, cnew}]
                        if !ok {
                            if rnew < rmin || cnew < cmin {
                                rmin, cmin = rnew, cnew
                            }
                            if rnew > rmin || cnew > cmin {
                                rmax, cmax = rnew, cnew
                            }
                            seen[Pair{r, c}] = true
                            land[rnew][cnew] = -1
                            dq = append(dq, []int{rnew, cnew})
                        }
                    }
                }
            }
        }
    }
    return land, rmin, cmin, rmax, cmax
}

func findFarmland(land [][]int) [][]int {
    res := [][]int{}
    seen := make(map[Pair]bool)
    rows := len(land)
    cols := len(land[0])
    for r := 0; r < rows; r++ {
        for c := 0; c < cols; c++ {
            if land[r][c] == 1 {
                rmin, cmin := r, c
                rmax, cmax := r, c
                seen[Pair{r, c}] = true
                land, rmin, cmin, rmax, cmax = bfs(r, c, rows, cols, rmin, cmin, rmax, cmax, land, seen)
                res = append(res, []int{rmin, cmin, rmax, cmax})
            }
        }
    }
    return res
}

